INSERT INTO invented_brand VALUES (1,'654321','2020-09-15 00:00:00','3','SUKANDI','JL. SENI BUDAYA I NO. 24 RT.005 / 005 KEL. JELAMBARBARU, KEC. GROGOL PETAMBURAN JAKARTA BARAT','Test','Test Alamat Kuasa','COSMO','Apalah artinya tu','COSMO: Sebuah Penamaan','31','===Makanan binatang peliharaan, makanan binatang ternak, makanan hewan untuk menguatkan dan menggemukkan, hasil produksi untuk alas tempat tidur binatang, binatang hidup, binatang kurungan, butiran beraroma harum untuk hewan peliharaan, minuman untuk binatang peliharaan, biscuit makanan anjing, daging ikan untuk kebutuhan binatang, garam untuk ternak, kertas amplas untuk hewan kesayangan, lapisan tanah yang berumput, ragi untuk binatang.===',NULL,'N','brm48-18.pdf','Y',1,'2020-09-24 23:23:19'),(2,'123456','2020-09-15 00:00:00','1','FEBRI ANDIKA','JL. DAHLIA KOMPLEKS DIAMOND RESIDENCE BLOK F NO. 4','NOCHI AYU RISANTI','JL. DAHLIA KOMPLEKS DIAMOND RESIDENCE BLOK F NO. 4','NOOBSCRIPT','SOFTWARE HOUSE','RED, GREEN, BLUE','1, 2, 3','LOREM IPSUM DOLOR',NULL,'Y','BRM2041A.pdf','Y',1,'2020-09-20 21:22:50');
